create table Students (
	firstName VARCHAR(50),
	middleName VARCHAR(50),
	lastName VARCHAR(50),
	email VARCHAR(50),
	telephone VARCHAR(50),
	street VARCHAR(50),
	city VARCHAR(50),
	state VARCHAR(50),
	zip VARCHAR(50),
	dob DATE,
	startDate DATE,
	gpa DECIMAL(3,2),
	registeredCourses VARCHAR(255)
);
